type PieChartConfig = {
  view: [number, number];
  isDoughnut: boolean;
  arcWidth: number;
  barChartcustomColors: BarChartCustomColors;
};

type BarChartCustomColors = [
  { name: 'Used'; value: string },
  { name: 'Remaining'; value: string }
];

type ColorMapper = {
  [packageType in PackageType]: BarChartCustomColors[];
};

export const PIE_CHART_CONFIG: PieChartConfig = {
  view: [150, 150],
  isDoughnut: true,
  arcWidth: 0.4,
  barChartcustomColors: [
    { name: 'Used', value: '#54B6FF' }, // Bright blue
    { name: 'Remaining', value: '#EEEEEE' }, // Bright gray
  ],
};
